import styled from 'styled-components'
import { Link } from 'react-router-dom'

export const NavBarStyle = styled.div`
background-color: black;

padding: 15px;



`

export const LinkStyle = styled(Link)`
text-decoration: none;
color: white;
display: inline;
padding: 100px;



`
